import React from 'react'

const EmployeeList = () => {
  return (
    <>
       <Card title={title} >
            <ListTable
                users={users}
                roles={roles}
                roleNames={roleNames}
                getUsers={getUsers}
                openUserForm={(user)=>openUserForm("edit",user)}
                handleCancel={handleCancel}
            />
         </Card>
         
    </>
  )
}
export default EmployeeList
